"use strict";(self.webpackChunk=self.webpackChunk||[]).push([[6254],{8089:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"colgate-hiring-test","metadata":{"permalink":"/job_hunting_notes/blog/colgate-hiring-test","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-10-10.md","source":"@site/blog/2022-10-10.md","title":"Hiring test afterthoughts","description":"Basic react questions, some of them seemed about error boundaries, seem to answer most of the questions correctly.","date":"2022-10-10T00:00:00.000Z","formattedDate":"October 10, 2022","tags":[{"label":"interviews","permalink":"/job_hunting_notes/blog/tags/interviews"}],"readingTime":1.13,"hasTruncateMarker":false,"authors":[{"name":"David Li","title":"React test","url":"https://github.com/FriendlyUser","image_url":"https://avatars.githubusercontent.com/u/13860264?v=4","imageURL":"https://avatars.githubusercontent.com/u/13860264?v=4"}],"frontMatter":{"slug":"colgate-hiring-test","title":"Hiring test afterthoughts","authors":{"name":"David Li","title":"React test","url":"https://github.com/FriendlyUser","image_url":"https://avatars.githubusercontent.com/u/13860264?v=4","imageURL":"https://avatars.githubusercontent.com/u/13860264?v=4"},"tags":["interviews"]},"nextItem":{"title":"First Blog Post","permalink":"/job_hunting_notes/blog/first-blog-post"}},"content":"Basic react questions, some of them seemed about error boundaries, seem to answer most of the questions correctly.\\n\\nCant publish this cause that unethetic, just keep it here\\n\\n```typescript\\nimport React from \'react\';\\n\\nclass AutocorrectTextarea extends React.Component {\\n  constructor(props) {\\n    super(props);\\n    // this.state = props;\\n    this.onTextInput = this.onTextInput.bind(this);\\n    this.state = {\\n      correctedText: \\"\\"\\n    }\\n  }\\n\\n  // take input and look for corrections\\n  onTextInput (e) {\\n    const currentText = e.target.value;\\n    // get corrections\\n    // split words assuming on space only\\n    const words  = currentText.split(\\" \\");\\n    // check for corrections if more than one space is available\\n    if (words.length < 1) {\\n      // one word, no space characters according to assignment, just return\\n      this.setState({\\n        correctedText: currentText\\n      });\\n    } else {\\n      // handle autocorrect on all words\\n      const correctedWords = words.map((word, index) => {\\n        // for last entry, no space yet, so just add the word and return\\n        if (index === words.length - 1) {\\n          return word;\\n        }\\n        // use object mapping for each word;\\n        // if there is a correction it should be found\\n        // ignore corrections if last word\\n        const correction = this.props.corrections[word];\\n        if (correction) {\\n          return correction;\\n        } else {\\n          return word;\\n        }\\n      })\\n      const correctedText = correctedWords.join(\\" \\")\\n      this.setState({\\n        correctedText\\n      });\\n    }\\n  }\\n  render() {\\n    return (\\n      <div className=\\"text-center\\">\\n        <textarea data-testid=\\"textarea\\" value={this.state.correctedText} rows={10} cols={80} className=\\"card\\" onChange={this.onTextInput} />\\n      </div>\\n    );\\n  }\\n}\\n\\nexport default AutocorrectTextarea;\\n```"},{"id":"first-blog-post","metadata":{"permalink":"/job_hunting_notes/blog/first-blog-post","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-08-15-orbis.md","source":"@site/blog/2022-08-15-orbis.md","title":"First Blog Post","description":"General:","date":"2022-08-15T00:00:00.000Z","formattedDate":"August 15, 2022","tags":[{"label":"interviews","permalink":"/job_hunting_notes/blog/tags/interviews"},{"label":"orbis","permalink":"/job_hunting_notes/blog/tags/orbis"}],"readingTime":1.145,"hasTruncateMarker":false,"authors":[{"name":"David Li","title":"Docusaurus Core Team","url":"https://github.com/FriendlyUser","image_url":"https://avatars.githubusercontent.com/u/13860264?v=4","imageURL":"https://avatars.githubusercontent.com/u/13860264?v=4"}],"frontMatter":{"slug":"first-blog-post","title":"First Blog Post","authors":{"name":"David Li","title":"Docusaurus Core Team","url":"https://github.com/FriendlyUser","image_url":"https://avatars.githubusercontent.com/u/13860264?v=4","imageURL":"https://avatars.githubusercontent.com/u/13860264?v=4"},"tags":["interviews","orbis"]},"prevItem":{"title":"Hiring test afterthoughts","permalink":"/job_hunting_notes/blog/colgate-hiring-test"},"nextItem":{"title":"Welcome","permalink":"/job_hunting_notes/blog/welcome"}},"content":"General:\\nTalk about a project you did.\\nTrivia:\\nWhat is the difference between C++ and C#?\\nWhat is the difference between an abstract class and interface?\\nLeetcode:\\n\\nDetermine is a string is a palidrome.\\nDetermine is two strings are isomorphic.\\nCoding:\\nDetermine what a function and identify errors (this was an erroneous implementation of mergesort)\\nWhat is a good example of interactive technology that you like? What makes it good? How is it different from its competitors? If you could change one thing about it, what would it be? Why do you think the company chose to do it this way and not another?\\nThere is a ladder and you can either step on every step or take two steps at a time. How many ways are there to climb a ladder with n steps.\\n\\nAsked a variety of leetcode, blanked off for a bit had a lousy solution could have done it better. LINQ implementation didnt use it.\\n\\nCould have used a for loop, but whatever it is what it is.\\n\\nAs for interview results, think I wont get a take home test, or they are trying to figure out my role, love stonk investing.\\n\\n\\nOne downside is hybrid work and having to go to the office and having to disclose my trades.\\n\\nWonder if they caught on to my github activity, should have changed it, oh well."},{"id":"welcome","metadata":{"permalink":"/job_hunting_notes/blog/welcome","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2021-08-26-welcome/index.md","source":"@site/blog/2021-08-26-welcome/index.md","title":"Welcome","description":"Docusaurus blogging features are powered by the blog plugin.","date":"2021-08-26T00:00:00.000Z","formattedDate":"August 26, 2021","tags":[{"label":"facebook","permalink":"/job_hunting_notes/blog/tags/facebook"},{"label":"hello","permalink":"/job_hunting_notes/blog/tags/hello"},{"label":"docusaurus","permalink":"/job_hunting_notes/blog/tags/docusaurus"}],"readingTime":0.405,"hasTruncateMarker":false,"authors":[{"name":"S\xe9bastien Lorber","title":"Docusaurus maintainer","url":"https://sebastienlorber.com","imageURL":"https://github.com/slorber.png","key":"slorber"},{"name":"Yangshun Tay","title":"Front End Engineer @ Facebook","url":"https://github.com/yangshun","imageURL":"https://github.com/yangshun.png","key":"yangshun"}],"frontMatter":{"slug":"welcome","title":"Welcome","authors":["slorber","yangshun"],"tags":["facebook","hello","docusaurus"]},"prevItem":{"title":"First Blog Post","permalink":"/job_hunting_notes/blog/first-blog-post"}},"content":"[Docusaurus blogging features](https://docusaurus.io/docs/blog) are powered by the [blog plugin](https://docusaurus.io/docs/api/plugins/@docusaurus/plugin-content-blog).\\n\\nSimply add Markdown files (or folders) to the `blog` directory.\\n\\nRegular blog authors can be added to `authors.yml`.\\n\\nThe blog post date can be extracted from filenames, such as:\\n\\n- `2019-05-30-welcome.md`\\n- `2019-05-30-welcome/index.md`\\n\\nA blog post folder can be convenient to co-locate blog post images:\\n\\n![Docusaurus Plushie](./docusaurus-plushie-banner.jpeg)\\n\\nThe blog supports tags as well!\\n\\n**And if you don\'t want a blog**: just delete this directory, and use `blog: false` in your Docusaurus config."}]}')}}]);